import React from "react";
import { DatePicker } from "antd";
import "moment/locale/es";
import locale from "antd/es/date-picker/locale/es_ES";
import "./App.scss";

function App() {
  const test = (date, dateString) => {
    alert(date, dateString);
  };

  return (
    <div className="app">
      <h1>
        Web personal <span>Web Hecha Por Antonio</span>
      </h1>
      <h2>jjljkj</h2>
      <p>Ese nekenss</p>
      <DatePicker locale={locale} onChange={test} />
    </div>
  );
}

export default App;
